import axios from "axios";

const url = "http://localhost:5000/tour";

export const fetchTeams = () => axios.get(url);

export const createTeam = async (newTeam) => {
    const res = await axios.post(url, newTeam);
    console.log("In axios");
    console.log(res);
    return res;
};
